import React from 'react';
import './styles.css'

const Contacto = () => {
  return (
    <div className='contactoContainer'>
        <div className='contactoOverlay'>
            <div className='contactTitle'></div>
            <div className='form'></div>
        </div>
    </div>
  )
}

export default Contacto
